import re
from collections import OrderedDict


def count_s(s, string):
    regexp = r'(?=(' + string + '))'
    return len(re.findall(regexp, s))


def gen(string, k, p):
    i = 0
    ret = []
    for c in s:
        fi = i + k
        if fi <= (len(s) - k):
            if(count_s(s[i:fi], p) > 0):
                ret.append(i)
            i = i + 1
    return ret

